import React from 'react'

const AllCourses = () => {
const getCourses = ()=>{
  axios.get("http://localhost:4200/course/all-courses",{
    headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
  })
}

  return (
    <div>AllCourses</div>
  )
}

export default AllCourses
